Great find John! Although we're on datasets 3.0.2 (https://github.com/KMFODA/DistributedTraining/blob/06680157dcf26db8897f7b3f20d7075c50e9b37b/requirements.txt#L3) and this issue seems to be specific to earlier versions. 

One thing I was playing around with on Friday that helped a bit with this is changing our delay mechanism by changing this:  https://github.com/KMFODA/DistributedTraining/blob/06680157dcf26db8897f7b3f20d7075c50e9b37b/distributed_training/data/dataset.py#L382 to `await asyncio.sleep(self.retry_delay*attempt*2)` and https://github.com/KMFODA/DistributedTraining/blob/06680157dcf26db8897f7b3f20d7075c50e9b37b/distributed_training/base/neuron.py#L132 to 60.

@Muhammad you can try this also if you're still facing the rate limiting issue.

@distributed・38 
As @shaners42 have been nice to point out, we are currently experiencing a bug where miners train on more inner_steps than the validators expect during validation. As an intermediate step we encourage all miners to reduce their `--self.config.neuron.target_n_blocks` to 1, which will align things with validation. 
A global fix will be implemented as soon as possible

@Karim @jundi69 
I'm not sure what's happening with the miners' incentives—it has been fluctuating unpredictably since the recent change. This issue is affecting my multiple miners. Before the change, everything was working fine and performance was optimized. You can verify the below key stats.
https://taostats.io/hotkey/5EsN7wripZrgvAR4GmZ6YZRciEHzrTmrimBwn99DC82t9169

@distributed・38  we've just merged the following PR https://github.com/KMFODA/DistributedTraining/pull/67 to take us up to v1.1.3. This small change is mostly focused on changing the influxdb url miners are reporting to and introduces a `get_uid` API which aims to improve synchronization amongst honest validators on which UIDs to evaluate each tempo.

Miners / Validators that aren't running with auto-updates please update to this latest version as soon as you can.

EDIT: We quickly release 1.1.4 straight after this with a patch fix for miners who will naturally not need the get_uid API

